import React, { useState } from "react";
import TabNavItem from "./AllTabs/TabNavItem";
import TabContent from "./AllTabs/TabContent";
import "./tabs.css"
import FiveDayForecast from "../DailyForecast/FiveDayWeather";
import DummyData from "../DummyData";

const [DayOne, DayTwo, DayThree, DayFour, DayFive]=DummyData
const day=[
{id:1, day:"Today"},
{id:2, day:"Tuesday"},
{id:3, day:"Wednesday"},
{id:4, day:"Thursday"}, 
{id:5, day: "Friday"}

]

console.log(DayOne)

const Tabs = () => {
  const [activeTab, setActiveTab] = useState("tab1");

  return (
    <>
        <ul className="nav">
        <TabNavItem
          title="Today"
          className="tab" id="tab1"
          activeTab={activeTab}
          setActiveTab={setActiveTab}
        />
        <TabNavItem
          title="Monday"
          id="tab2"
          activeTab={activeTab}
          setActiveTab={setActiveTab}
        />
        <TabNavItem
          title="Tuesday"
           id="tab3"
          activeTab={activeTab}
          setActiveTab={setActiveTab}
        />

        <TabNavItem
          title="Wednesday"
           id="tab4"
          activeTab={activeTab}
          setActiveTab={setActiveTab}
        />
            <TabNavItem
          title="Thursday"
          id="tab5"
          activeTab={activeTab}
          setActiveTab={setActiveTab}
        />
      </ul>

    <div className="Tabs weatherContainer">

      <div className="outlet">
      {day.map((dayInfo)=>{
        return(
        <TabContent className="tab"  key={dayInfo.id} id="tab1" activeTab={activeTab}>
         <FiveDayForecast day={dayInfo.day}  />
        </TabContent>
        )

      })}
      </div>
    </div>
    </>
  );
};

export default Tabs;
